import React, { useState } from "react";
import {
    StyleSheet,
    Text,
    View,
    ImageBackground,
    TextInput,
    TouchableWithoutFeedback,
    Keyboard,
    KeyboardAvoidingView,
    Platform,
    Alert,
    Button,
} from 'react-native';

export default function RegistrationScreen() {
    return (
        <View style={styles.container}>

        </View>
    );

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
        backgroundColor: '#fff',
        maxWidth: 375,
    },
   image: {
       flex: 1,
       resizeMode: 'cover',
       justifyContent: 'center',
    },
    inputContainer: {
        flex: 1,
        justifyContent: 'center',
        marginTop: 263,
        backgroundColor: '#fff',
    },
    title: {
        marginTop: 92,
        textAlign: "center",
        fontSize: 30,
        fontWeight: "bold"
    }
});
